import Nav from "react-bootstrap/Nav";
export const Navbar = () => {
  return (
    <>
      <nav class="mb-3 navbar navbar-light bg-light">
        <div class="container-fluid">
          <a href="#" class="navbar-brand">
            Navbar Offcanvas
          </a>
          
        </div>
      </nav>
    </>
  );
};
